import React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import { PropTypes } from 'prop-types';
import Typography from "@mui/material/Typography";
import { Button, Grid, Stack, Toolbar, CssBaseline, useScrollTrigger, Container } from "@mui/material";
import { Link } from "react-router-dom";

import "./navbar.css"

function ElevationScroll(props) {
  const { children, window } = props;
  // Note that you normally won't need to set the window ref as useScrollTrigger
  // will default to window.
  // This is only being set here because the demo is in an iframe.
  const trigger = useScrollTrigger({
    disableHysteresis: true,
    threshold: 0,
    target: window ? window() : undefined,
  });
}

export default function NavBar() {
  return (
    <div>
      <Box>
        <AppBar
          sx={{
            backgroundColor: "transparent",
            boxShadow: "none",
            padding: "1em 2em",
            height: "10%",
          }}
        >
          <Grid container direction={"row"}>

            <Grid item xs={4}>
              <Link to="/">
                <Typography variant="h5" component="div" className="logo_title">
                  Find-A-Crop
                </Typography>
              </Link>
            </Grid>

            <Grid
              item
              xs={2}
              sx={{
                display: "flex",
                justifyContent: "center",
                paddingLeft: "100px",
              }}
            >
              <Typography variant="h5" noWrap component="div" className="main_title">
                Name-A-Crop
              </Typography>
            </Grid>
            <Grid item xs={6}>
              <Stack
                direction="row"
                spacing={7}
                sx={{
                  display: "flex",
                  justifyContent: "flex-end",
                }}
              >
                <Link to="/signup">
                  <Button variant="outlined" size="large">
                    {" "}
                    <Typography variant="button" display="block">
                      SIGNUP
                    </Typography>
                  </Button>
                </Link>

                <Link to="/login">
                  <Button
                    variant="contained"
                    size="large"
                    sx={{
                      backgroundColor: "#308335",
                    }}
                  >
                    LOGIN
                  </Button>
                </Link>
              </Stack>
            </Grid>
          </Grid>
        </AppBar>
      </Box>
    </div>
  );
}
